import React from "react";

export default function CounterApp() {
  return (
    <>
      <button type="button" style={{ marginLeft: 20 }} className="increment">
        Increment
      </button>
      <h3>value: {}</h3>
      <button type="button" className="decrement">
        Decrement
      </button>
    </>
  );
}
